INSERT INTO `book` VALUES (1,'Bìa mềm','Lập Trình C++ và Hướng Đối Tượng',1636580807194,'Lập Trình C++ Và Hướng đối tượng',293,12000,2018,0,'data:image/jpeg;base64,',1,2),(2,'Bìa Mềm','Toán Cao Cấp 1 - Nhà Xuất Bản Giáo Dục Việt Nam',1636838538949,'Toán cao cấp 1',199,140000,2018,0,'data:image/webp;base64,',2,3),(3,'Bìa Mềm','Toán cao câp tập 2 - Nhà xuất Bản Giáo dục Việt Nam',1636839333015,'Toán cao cấp 2',300,50000,2018,0,'data:image/webp;base64,',2,3),(4,'Bìa mềm','Clean Code được chia thành ba phần. Phần đầu tiên mô tả các nguyên tắc, mẫu và thực hành viết mã sạch. Phần thứ hai bao gồm một số nghiên cứu trường hợp về sự phức tạp tăng dần. Mỗi trường hợp là một bài tập trong việc làm sạch mã nguồn mà bạn code. Phần thứ ba là phần thưởng: một chương duy nhất chứa một danh sách các code xấu không đẹp được tập hợp. Kết quả đúc kết một cơ sở kiến ​​thức mô tả cách chúng ta suy nghĩ khi chúng ta viết, đọc và làm sạch mã.',1637589421622,'CLEAN CODE',464,199000,2008,0,'data:image/jpeg;base64,',1,4),(5,'Bìa mềm','Hiện tại, trên thị trường sách Việt Nam với chủ đề về IT nói chung và lập trình viên nói riêng đều rất khan hiếm, chủ yếu là dịch lại từ tác giả nước ngoài. Chúng ta đã quá mải mê vào những đầu sách dạng “Những cách làm giàu hay đại loại vậy” đã khiến chúng ta ảo tưởng phần nào về bản thân mà thật sự kỹ năng của bạn không cho phép để làm điều đó.',1637589801490,'CODE DẠO KÝ SỰ',266,145000,2017,0,'data:image/jpeg;base64,',1,5),(6,'Bìa mềm','The Pragmatic Programmer minh họa thực tiễn tốt nhất và những cạm bẫy lớn của nhiều khía cạnh khác nhau của sự phát triển phần mềm. Cho dù bạn là một lập trình viên mới, hay là một lập trình viên có nhiều  kinh nghiệm. Quyển sách này sẽ không chỉ đề cập về code, mà sẽ nói nhiều về các vấn đề xung quanh đặc biệt là cách bạn bảo vệ sản phẩm của mình, được rút ra từ chính kinh nghiệm thực tế của người viết.',1637590313685,'The Pragmatic Programmer',320,500000,1999,0,'data:image/jpeg;base64,',1,6);
